import { createFeatureSelector, createSelector } from "@ngrx/store";
export const selectPracticeLogState = createFeatureSelector('practiceLogState');
export const selectPracticeLogs = () => createSelector(selectPracticeLogState, state => state.practiceLogs);
export const selectPracticeLog = id => createSelector(selectPracticeLogState, state => state.practiceLogs.find(d => d.id === id));
